function getDomManipulator(params) {
    
    const webchatContainerElement = document.getElementById(params.webchatContainerElementId);
    const overlayElement = document.getElementById('overlay');
    //const webchatIconMinimize = document.getElementById("icon-minimize");

    let stateMachineService;
    let webchatButtonContainerElement;
    let webchatWindowElement;
    
    //Agregados ICBC
    let webchatSitioInstPrincipal;    

    function insertElement(newElementType, newElementParent, textToInsert, newElementClass = '') {
        const newElement = document.createElement(newElementType);
        newElementParent.appendChild(newElement);
        const textNode = document.createTextNode(textToInsert);
        newElement.appendChild(textNode);
        if (newElementClass != '') {
            newElement.classList.add(newElementClass);
        }
        return newElement;
    };

    return {

        setStateMachineService: function(service) {
            stateMachineService = service;
        },

        addWebchatButtonAndWindow: function () {
            // add webchat button:
            webchatButtonContainerElement = insertElement('div', webchatContainerElement, '', '');
            webchatButtonContainerElement.id = 'webchat-button';
            const webchatButtonImage = insertElement('img', webchatButtonContainerElement, '', '');
            webchatButtonImage.setAttribute('src', params.webchatIcon);
            webchatButtonContainerElement.addEventListener('click', () => stateMachineService.send('SHOW_WEBCHAT'));

            // add webchat window:
            webchatWindowElement = insertElement('div', webchatContainerElement, '', 'webchat-hidden');
            webchatWindowElement.classList.add('webchat-right');
            webchatWindowElement.id = 'webchat-container';

            const webchatHeaderContainer = insertElement('section', webchatWindowElement, '', '');
            webchatHeaderContainer.id = 'webchat-header-section';

            const webchatHeader = insertElement('header', webchatHeaderContainer, params.botHeaderText, '');
            webchatHeader.id = 'webchat-header';

            const webchatNav = insertElement('nav', webchatHeaderContainer, '', '');
            if (params.showSidewaysButton == 'true')
            {
                const iconSwitch = insertElement('span', webchatNav, '', 'webchat-ms-Icon');
                iconSwitch.classList.add('webchat-ms-Icon--Switch');
                iconSwitch.id = 'icon-switch';
                iconSwitch.addEventListener('click', () => stateMachineService.send('TOGGLE_SIDE'));
            }

            const iconMinimize = insertElement('span', webchatNav, '', 'webchat-ms-Icon');
            iconMinimize.classList.add('webchat-ms-Icon--ChromeClose');
            iconMinimize.id = 'icon-minimize';
            iconMinimize.addEventListener('click', () => stateMachineService.send('HIDE_WEBCHAT'));

            const webchatBox = insertElement('div', webchatWindowElement, '', '');
            webchatBox.id = 'webchat-box';

            overlayElement.addEventListener('click', () => stateMachineService.send('HIDE_WEBCHAT'));                
            // Agregado ICBC
            //webchatIconMinimize.addEventListener("click" , () => stateMachineService.send('HIDE_WEBCHAT'))
        },
            
        showWebchatWindow: function() {
            webchatWindowElement.classList.remove('webchat-hidden');
            webchatButtonContainerElement.style.display = 'none';
            overlayElement.style.display = "block";

            webchatSitioInstPrincipal = document.getElementById("sitio-inst-principal");
            webchatSitioInstPrincipal.style.display = "none";

        },
        hideWebchatWindow: async function() {
            webchatWindowElement.classList.add('webchat-hidden');
            webchatButtonContainerElement.style.display = 'flex';
            overlayElement.style.display = "none";

            webchatSitioInstPrincipal = document.getElementById("sitio-inst-principal");
            webchatSitioInstPrincipal.style.display = "block";
        },

        setFocusOnWebchatInputBox: function() {
            const webchatInputBox = document.querySelector('.webchat__send-box-text-box__input');
            webchatInputBox?.focus();
        },     

        moveWebchatWindowToRightPosition: function () {
            webchatWindowElement.classList.remove('webchat-left');
            webchatWindowElement.classList.add('webchat-right');
        },
        moveWebchatWindowToLeftPosition: function () {
            webchatWindowElement.classList.remove('webchat-right');
            webchatWindowElement.classList.add('webchat-left');
        },

        enableUploadButton: function () {
            if (params.showUploadButton == 'true') {
                const element = document.querySelector('div.webchat__upload-button');
                element.style.opacity = 1;
                if (document.getElementById('eds-button-upload-shade')) {
                    document.getElementById('eds-button-upload-shade').remove();
                }
            } else {
                const element = document.querySelector('div.webchat__upload-button');
                element.style.display = 'none';
            }
        },

        disableUploadButton: function () {
            if (params.showUploadButton == 'true') {
                const element = document.querySelector('div.webchat__upload-button');
                element.style.opacity = .2;
                if (!document.getElementById('eds-button-upload-shade')) {
                    const buttonShade = insertElement('div', element, '', 'webchat-button-shade');
                    buttonShade.id = 'eds-button-upload-shade';    
                }
            } else {
                const element = document.querySelector('div.webchat__upload-button');
                element.style.display = 'none';
            }
        },

        enableSpeakButton: function () {
            if (params.useDirectLineSpeech == 'true') {
                if (params.showSpeakButton == 'true') {
                    const element = document.querySelector('div.webchat__microphone-button');
                    element.style.opacity = 1;
                    if (document.getElementById('eds-button-speak-shade')) {
                        document.getElementById('eds-button-speak-shade').remove();
                    }
                } else {
                    const element = document.querySelector('div.webchat__microphone-button');
                    element.style.display = 'none';
                }
            }
        },

        disableSpeakButton: function () {
            if (params.useDirectLineSpeech == 'true') {
                if (params.showSpeakButton == 'true') {
                    const element = document.querySelector('div.webchat__microphone-button');
                    element.style.opacity = .2;
                    if (!document.getElementById('eds-button-speak-shade')) {
                        element.style.position = 'relative';
                        const buttonShade = insertElement('div', element, '', 'webchat-button-shade');
                        buttonShade.id = 'eds-button-speak-shade';    
                    }
                } else {
                    const element = document.querySelector('div.webchat__microphone-button');
                    element.style.display = 'none';
                }
            }
        },

        startUploadButtonAnimation: function () {
            const attachFileIcon = document.querySelector('button.webchat__icon-button svg');
            attachFileIcon.classList.add('attach-file-icon-animation');
            setTimeout(() => {stopUploadButtonAnimation()}, 3000);
        },
        
        stopUploadButtonAnimation: function () {
            const attachFileIcon = document.querySelector('button.webchat__icon-button svg');
            attachFileIcon.classList.remove('attach-file-icon-animation');
        },

        showCloseConversationLink: function() {
            const sendBoxElement = document.getElementsByClassName('webchat__send-box__main')[0];
            sendBoxElement.innerHTML = '<button class="button-close" ' + (
                    params.allowConversationReconnect == 'true'
                    ? `onclick="window.EdsWebChatStateMachineService.send('REMOVE_WEBCHAT');" `
                    : `onclick="window.EdsWebChatStateMachineService.send('HIDE_WEBCHAT');" `
                ) +
                'style="font-family: Calibri, Helvetica Neue, Arial, sans-serif; cursor: pointer;">Cerrar</button>';            
            sendBoxElement.style.justifyContent = 'center';
            sendBoxElement.style.alignItems = 'center';
        },
        
        removeWebchatButtonAndWindow: function() {
            webchatWindowElement.remove();
            webchatWindowElement = undefined;
            webchatButtonContainerElement.remove();
            webchatButtonContainerElement = undefined;
            overlayElement.style.display = "none";
            stateMachineService.send('REMOVAL_COMPLETE');
        }
    };
};

