async function uploadFileToAzureStorage(file, params) {
    const { name, size, url, thumbnail } = file;
    const { fetchUploadSasTokenUrl, debugLogs } = params;

    if (debugLogs) {
        console.log('[EDS] uploadFileToAzureStorage:');
        console.log(file);
    }

    const res = await fetch(url);
    if (! res.ok) {
        throw new Error('Cannot obtain ArrayBuffer to upload file');
    }
    const arrayBuffer = await res.arrayBuffer();
    const contentType = getContentTypeFromDataUrl(thumbnail);

    // Fetch a SAS (Shared Access Signature) token from the API server,
    // think of it as a permission to upload a single file to Azure Storage:
    const { uploadUrl, sasQueryParams } = await fetchJSON(fetchUploadSasTokenUrl);

    // Upload the file to Azure Storage directly by using a fresh SAS token from the API server:
    const blockBlobClient = new BlockBlobClient(`${uploadUrl}${sasQueryParams}`);
    const uploadBlobResponse = await blockBlobClient.upload(
        arrayBuffer, arrayBuffer.byteLength, { metadata: 
            contentType
            ? { name, contentType }
            : { name }
        });

    // Log the upload operation result if required:
    if (debugLogs) {
        console.log(`[EDS] File upload result: status=${uploadBlobResponse._response.status} url=${uploadUrl}`);
        if (uploadBlobResponse._response.status != 201) {
            console.log(uploadBlobResponse);
        }
    }

    // Return information about the file uploaded to Azure Storage:
    return { name, size, contentUrl: uploadUrl, thumbnailUrl: thumbnail, contentType };
};

// This is a helper function for fetching JSON resources.
async function fetchJSON(url, options = {}) {
    const res = await fetch(url, {
        ...options,
        headers: {
        ...options.headers,
        accept: 'application/json'
        }
    });

    if (! res.ok) {
        throw new Error(`Failed to fetch JSON due to ${res.status}`);
    }

    return await res.json();
};

function getContentTypeFromDataUrl(dataUrl) {
    let result = undefined;
    if (typeof dataUrl == 'string') {
        if (dataUrl.startsWith('data:')) {
            result = 'text/plain;charset=US-ASCII';
            const contentTypeRegEx = /^data:(.*?)(;base64)?,.*$/;
            const matchedArray = dataUrl.match(contentTypeRegEx);
            if (matchedArray.length > 1) {
                result = matchedArray[1];
            }
        }
    }
    return result;
}

